 WHERE Ve_ExpertoDiagnostico.Edad >=',var_EdadBuscar,' and Ve_ExpertoSintoma.Sintoma in (',var_CriterioSintomaBuscar,')

GROUP BY

Ve_ExpertoDiagnostico.IdDiagnostico,



